import requests
import json
from pool import *


def html_get(p):
    """
    :param p: 页数
    :return:
    """
    headers = {
        # 'authority': 'suning.m.tmall.com',
        'user-agent': get_ua(),
        'cookie': '有免登陆的万能cookie,一个多月没过期',
    }
    params = {"p": p}
    url = "https://suning.m.tmall.com/shop/shop_auction_search.do"
    # url = "https://svw.m.tmall.com/shop/shop_auction_search.do"
    html = requests.get(url=url, headers=headers, params=params)
    print(html.text)
    return html.json()


def parse(page):
    data = {}
    for p in range(1, page + 1):
        response = html_get(p)
        if p != 1:
            items = response['items']
            data["items"] += items
        else:
            data = response
    print(json.dumps(data))


